function.html.body:
Function
Adalah sebuah sebuah aksi yang dienkapsulasi agar bisa digunakan berulangkali. Tujuan menuliskan sebuah function adalah untuk menyembunyikan detail algoritma yang panjang dan rumit supaya lebih mudah digunakan. Penulisan function diawali dengan keyword function. 
Penamaan
Ada beberapa jenis function dalam Javascript. Yaitu function yang bernama dan function yang tak bernama (anonymous).

Function bernama

// Function yang bernama greeting
function greeting() {
  console.log("Halo")
}
greeting() // log: "Halo"


Anonymous Function yang dimasukkan ke dalam sebuah variable

// Anonymous Function yang dimasukkan ke dalam sebuah variable sapa
const sapa = function() {
  console.log("Hai")
}
sapa() // log: "Hai"


Anonymous Function yang dimasukkan ke dalam field sebuah object

// Anonymous Function yang dimasukkan ke field greeting
const obj = {
  greeting() {
    console.log("Hola")
  }
}

obj.greeting() // log: "Hola"

Argumen
Setiap function juga bisa menerima argumen. Boleh satu boleh lebih. berikut contoh penerimaan 1 argumen pada function 
function greeting(nama) {
  console.log("Halo " + nama)
}

const sapa = function(orang) {
  console.log("Hai " + orang)
}

const obj = {
  greeting(user) {
    console.log("Hola " + user)
  }
}

const targetOrang =  "Naufal"

greeting(targetOrang) // log: "Halo Naufal"
sapa(targetOrang) // log: "Hai Naufal"
obj.greeting(targetOrang) // log: "Hola Naufal"


Function dengan lebih dari 1 argumen

// Contoh lebih dari satu argumen
function tambahkan(a, b) {
  const total = a + b
  console.log(total)
}

tambahkan(10, 5) // log: 15

Return
return adalah salah satu keyword yang wajib dipahami. fungsinya adalah untuk memberikan nilai balikan pada suatu function. Berikut demonstrasinya.
// function tak bernilai
function greeting(nama) {
  const gabungan = "Hai " + nama
}

const hasilGreeting = greeting("Naufal")
console.log(hasilGreeting) // log: undefined

function sapa(nama) {
  const sapaan = "Hai " + nama
  return sapaan
}

const hasilSapa = sapa("Naufal")
console.log(hasilSapa) // log: "Hai Naufal"

function tambahkan(angka1, angka2) {
  const total = angka1 + angka2
  return total
}

const hasilPertambahan = tambahkan(10, 5)
console.log(hasilPertambahan) // log: 15

// Atau bisa langsung diconsole
console.log(tambahkan(2, 5)) // log: 7

Nilai balikan suatu function tidak memiliki batasan. Jadi bisa return string, number, object ataupun array. Apapun itu. Contoh return suatu object.
const returnObject = () => {
  return {
    nama: "Naufal",
    username: "BosNaufal"
  }
}

console.log(returnObject()) // log: { nama: "Naufal", username: "BosNaufal" }

import-export.html.body:
Import Export
import dan export adalah keyword yang digunakan untuk mengekspos sebuah module dan untuk menggunakannya di module lain. 
Jadi, jika menggunakan Node JS atau Webpack, maka antara file javascript yang satu dengan yang lain, tidak saling berhubungan, variabelnya tidak bisa diakes secara langsung satu sama lain. kecuali melakukan export dan import.
Kasus
Oke semisal ada 2 file javascript. yang satu adalah kumpulan variable, yang satu adalah function yang berusaha mengakses variable-variable tersebut.
// file: biodata.js

const biodata = {
  nama: "Naufal",
  umur: 21,
  asal: "Sidoarjo",
}

console.log(biodata) // log: { nama: "Naufal", ... }

// file: main.js

console.log(biodata) // error
// Karena variable biodata tidak ada pada file ini

const getUserInfo = (info) => {
  console.log("Nama:  " + info.nama)
  console.log("Umur: " + info.umur)
  console.log("Asal: " + info.asal)
}

getUserInfo(biodata) // error
// Karena variable biodata tidak ada pada file ini

Basic
Tapi jika melakukan export import, maka antar module bisa berbagi variable. Semisal
// file: biodata.js

const biodata = {
  nama: "Naufal",
  umur: 21,
  asal: "Sidoarjo",
}

export default biodata

// file: main.js

/*
  biodataUser adalah nama alias dari variable yang diimport
  nama alias bisa diganti bebas
*/
import biodataUser from './biodata.js' 

console.log(biodataUser) // log: { nama: "Naufal", ... }

const getUserInfo = (info) => {
  console.log("Nama:  " + info.nama)
  console.log("Umur: " + info.umur)
  console.log("Asal: " + info.asal)
}

getUserInfo(biodataUser)
/**
  log: 
    Nama: Naufal
    Umur: 21
    Asal: sidoarjo
**/

Export Type
Ada beberapa cara untuk melakukan export. yaitu dengan export biasa, dan export default. 
export default ini akan memberikan nilai sesuai nilai variable yang diexport tanpa harus mengimportnya secara spesifik.
Sedangkan export biasa akan mewajibkan untuk memilih bagian module mana yang hendak di-import secara spesifik
// file: biodata.js

const user = {
  nama: "Naufal",
  lastName: "Rabbani",
  umur: 21,
  asal: "Sidoarjo",
}

// Perhatikan
export {
  fullName: (user.name + user.lastName),
}

// Perhatikan
export default user


import tidak sepesifik (default)

// file: main.js
import biodataUser from './biodata.js'


import sepesifik. Wajib menuliskan nama variablenya

// file: main.js
import { fullName } from './biodata.js'


Penggunaan import default dan import spesifik secara bersamaan.

// file: main.js
import biodataUser, { fullName } from './biodata.js' 

console.log(biodataUser) // log: { nama: "Naufal", ... }

console.log(fullName) // log: "Naufal Rabbani"

es6.html.body:
ES6
Pada section ini akan dibahas beberapa bagian kecil fitur dari ES6. ES6 adalah javascript next level yang memiliki sintaks yang lebih cantik dan beberapa fitur unggulan lainnya. Ada beberapa fitur ES6 yang baiknya dikuasai terlebih dahulu untuk modal melanjutkan untuk belajar React / Vue / Angular. Tujuannya agar tulisan code lebih rapi.
Destructure
Destructure adalah fitur ES6 yang memungkinkan untuk membongkar field suatu object atau member dari array agara menjadi variable independen.
Pada javascript model lama, harus melakukannya secara manual untuk menghasilkan nama variable yang lebih singkat untuk dipanggil.
const user = {
  nama: "Naufal",
  usia: 21,
  alamat: "Sidoarjo",
}

const nama = user.nama
const usia = user.usia

console.log(nama, usia) // log: "Naufal", 21

const dariArray = ["Naufal", "Sidoarjo"]

// Cara Manual
const nama = dariArray[0]
const alamat = dariArray[1]

Nah berbeda dengan ES6. Cukup melakukan ini
const user = {
  nama: "Naufal",
  usia: 21,
  alamat: "Sidoarjo",
}

// Cara ES6
const { nama, usia } = user
console.log(nama, usia) // log: "Naufal", 21

const dariArray = ["Naufal", "Sidoarjo"]

// Cara ES6
const [ nama, alamat ] = dariArray
console.log(nama, alamat) // log: "Naufal", "Sidoarjo"

Destructure ini sering digunakan untuk membongkar argumen object pada suatu function.

Cara lama / manual

const cekMobil = (mobilYangDicek) => {
  let merk = mobilYangDicek.merk
  let warna = mobilYangDicek.warna

  console.log("Mobil bermerk:", merk)
  console.log("Mobil berwarna:", warna)
}

const mobil = {
  merk: "Honda",
  warna: "Merah",
}

cekMobil(mobil)


Cara ES6 (Destructure)

const cekMobil = ({ merk, warna }) => {
  console.log("Mobil bermerk:", merk)
  console.log("Mobil berwarna:", warna)
}

const mobil = {
  merk: "Honda",
  warna: "Merah",
}

cekMobil(mobil)

Spread Syntax
adalah kemampuan untuk memecah array atau object untuk diedit atau ditambah isinya. setiap spread syntax akan mengopy nilai dari array atau object tersebut secara mendetil.
const arr = [1,2,3]
const arrBaru = [...arr, 4]
const arrLain = [0, ...arr]

console.log(arr) // log: 1,2,3
console.log(arrBaru) // log: 1,2,3,4
console.log(arrLain) // log: 0,1,2,3

const obj = {
  nama: "Naufal",
  alamat: "Sidoarjo",
}

const objBaru = {
  ...obj,
  usia: 21,
}
console.log(obj) // log: { nama: "Naufal", alamat: "Sidoarjo" }
console.log(objBaru) // log: { nama: "Naufal", alamat: "Sidoarjo", usia: 21 }

const argumentToPass = ["Naufal", "Sidoarjo"]

const showUser = (nama, alamat) => {
  console.log(nama, alamat)
}

showUser(...argumentToPass) // log: "Naufal", "Sidoarjo"

Arrow Function
Arrow function adalah function yang tidak mempunyai context this. context this yang ada pada arrow function tergantung pada context this yang berada paling dekat di atasnya.

function mobil() {
  this.merk = "Honda"

  console.log(this.merk) // log: "Honda"

  // Function biasa
  const nestedFunction = function() {
    console.log(this.merk) // log: undefined
  }

  // Arrow Function
  const arrowFunction = () => {
    console.log(this.merk) // log: "Honda"
  }

  nestedFunction()  
  arrowFunction()  
}

mobil()

class.html.body:
Class Javascript
Javascript lebih identik dengan functional programing. Tapi bukan berarti di Javascript tidak ada OOP (Object Oriented Programming). ES6 menghadirkan sintaks baru yaitu class yang telah diadopsi dan digunakan dibanyak library JS. React pun menggunakan ES6 Class.
Class
class adalah gambaran atau rancangan atau blueprint dari suatu object instance. Terkadang agak membingungkan di javascript karena ada object type ada juga object instance. Object Type adalah variabel bertipe object yang telah dibahas sebelumnya. sedangkan object instance adalah hasil dari inisiasi suatu class.
class Mobil {
  constructor() {
    this.merk = "Honda"
  }

  cekMerk() {
    console.log(this.merk)
  }
}

// Inisiasi object instance
const mobilku = new Mobil();
mobilku.cekMerk() // log: "Honda"

Jika melihat contoh kode diatas, Mobil adalah nama class atau nama blueprint. Sedangkan mobilku adalah variabel yang berisi object instance dari class Mobil.

Satu class bisa menghasilkan beberapa object instance.

class Mobil {
  constructor(merk) {
    this.merk = merk
  }

  cekMerk() {
    console.log(this.merk)
  }
}

// Inisiasi object instance
const mobilku = new Mobil("Alphard");
mobilku.cekMerk() // log: "Alphard"

const mobilnya = new Mobil("Honda");
mobilnya.cekMerk() // log: "Honda"

Dari contoh diatas, terdapat 2 object instance dari 1 class Mobil. yang tidak saling mempengaruhi satu sama lain. 
Property
Property adalah atribut yang melekat pada suatu class. Misal, ada class Mobil maka property yang bisa dibuat untuk class Mobil adalah merk, warna, jenis, dsb. 
Dan berikut contoh penulisan property pada suatu class
class Mobil {
  constructor() {
    this.merk = "Honda"
    this.warna = "hitam"
    this.jenis = "sedan"
    this.roda = 4
  }
}

Untuk mengakses ataupun mengedit suatu property, menggunakan this.namaProperty.
class Mobil {
  constructor() {
    this.merk = "Honda"
    this.warna = "hitam"
    this.jenis = "sedan"
    this.roda = 4
  }

  hitungRoda() {
    console.log(this.roda)
  }

  tambahRoda() {
    this.roda++
    this.hitungRoda()
  }
}

// Inisiasi object instance
const mobilku = new Mobil()
mobilku.hitungRoda() // log: 4
mobilku.tambahRoda() // log: 5

Method
Method adalah sebuah aksi yang ada pada suatu class. Method berbentuk function. Method pada suatu class mempunyai behaviour yang sama dengan function. Ada baiknya teman-teman membaca terlebih dahulu bab tentang function
class Mobil {
  constructor() {
    this.merk = "Honda"
    this.warna = "hitam"
    this.jenis = "sedan"
    this.roda = 4
  }

  getWarna() {
    console.log(this.warna)
  }

  gantiWarna(warna) {
    this.warna = warna
  }
}

// Inisiasi object instance
const mobilku = new Mobil()
mobilku.getWarna() // log: hitam
mobilku.gantiWarna("pink")
mobilku.getWarna() // log: pink

Dari kode diatas, getWarna dan gantiWarna adalah sebuah method dari class Mobil. Apakah constructor juga sebuah method?
Constructor
constructor juga merupakan sebuah method yang dijalankan pertama kali saat proses inisiasi sebuah object instance.
class Mobil {
  constructor() {
    console.log("ini auto jalan duluan!")
  }

  methodBiasa() {
    console.log("Aktif bila dipanggil")
  }
}

// Inisiasi object instance
const mobilku = new Mobil() // log: ini auto jalan duluan!
mobilku.methodBiasa() // log: Aktif bila dipanggil

this
context this adalah salah satu bab yang harusnya dibahas lebih dalam. tapi untuk saat ini, teman-teman cukup perlu tahu bahwa this berfungsi untuk mengakses keseluruhan yang ada pada class. Entah itu sebuah property maupun method.
class Mobil {
  constructor() {
    // untuk set property
    this.roda = 4
  }

  hitungRoda() {
    // Untuk akses property
    console.log(this.roda)
  }

  tambahRoda() {
    this.roda++
    // Untuk memanggil method dari class Mobil itu sendiri
    this.hitungRoda()
  }
}


Jadi, method maupun property bisa saling memanggil satu sama lain.

static
static adalah sebuah tanda bahwa suatu  method pada class tersebut bisa diakses secara langsung tanpa harus melakukan inisiasi terlebih dahulu.
class Siswa {
  constructor() {
    this.nama = "Rinjani"
  }

  static bisaLangsung() {
    console.log("Langsung Akses!")
  }

  methodBiasa() {
    console.log("Method biasa")
  }
}

Siswa.bisaLangsung() // log: Langsung Akses!
Siswa.methodBiasa() // error: Siswa.methodBiasa is not a function

Hanya saja pada method static tidak bisa mengakses konteks this. Jadi tidak bisa mengakses property yang ada pada class tersebut.
class Siswa {
  constructor() {
    this.nama = "Rinjani"
  }

  static bisaLangsung() {
    console.log("Langsung Akses!", this.nama)
  }

  methodBiasa() {
    console.log("Method biasa", this.nama)
  }
}

// Menggunakan inisiasi
const siswaBaik = new Siswa()
siswaBaik.methodBiasa() // log: Method biasa Rinjani

// Tanpa inisiai
Siswa.bisaLangsung() // log: Langsung Akses! undefined

Inheritance
Inheritance biasa disebut turunan. Yang artinya bisa menambahkan atau memodifikasi class yang sudah ada tanpa harus menyentuhnya secara langsung. Semua behaviour yang ada pada class induk akan ikut terbawa pada class turunannya.
class Induk {
  constructor() {
    this.nama = "Induk"
    console.log("Aku siap!")
  }

  methodInduk() {
    console.log("Namaku", this.nama)
  }
}

class Anak extends Induk {
  constructor() {
    // wajib dipanggil untuk memanggil constructor dari parent
    super()
  }

  methodTambahanDariAnak() {
    console.log("Namaku dari:", this.nama)
  }
}

const induknya = new Induk() // log: Aku siap!
induknya.methodInduk() // log: Namaku Induk

const anaknya = new Anak() // log: Aku siap!
anaknya.methodTambahanDariAnak() // log: Namaku dari: Induk
anaknya.methodInduk() // log: Namaku Induk -> method dari induk tetap ada

Perhatikan contoh diatas. padahal pada kelas Anak, tidak ada property nama tapi class Anak tetap memiliki property nama yang berasal dari Induk.
Perhatikan lagi pada constructor. pada saat pertama kali inisiasi, class Induk akan mengatakan aku siap! pada class Anak juga begitu. karena constructor dari Induk, diturunkan ke class Anak. Itu yang menyebabkan behaviour dari keduanya sama.

react-dan-javascript.html.body:
React Dan Javascript
Bab ini adalah bridging atau bab yang akan menjembatani teman-teman untuk belajar React JS. Sayangnya untuk mempraktikannya, harus melakukan installasi node js dan create-react-app terlebih dahulu. Tapi untuk sekedar mengerti sekilas tentang react. Boleh melanjutkan membaca.
Sekilas Tentang React
React adalah library javascript yang berfungsi untuk membuat user interfaces. React ditulis dengan bahasa javascript dan JSX. JSX sendiri adalah templating language yang ada di javascript atau untuk lebih mudahnya bisa disebut HTML in JS.
Component Based
React datang dengan memperkenalkan konsep Component Based yang memungkinkan developer untuk memecah semua bagian halaman web menjadi komponen - kompnen kecil. Tujuannya adalah agar komponen tersebut bisa digunakan berulang kali ataupun di halaman lain dan mudah untuk diperbaikki.

Gambar diatas adalah contoh cara berpikir saat menggunakan React. yaitu dengan melakukan breakdown pada halaman hingga menjadi komponen-komponen kecil yang memiliki fungsi tertentu pada masing-masing komponennya. 
Reusable
Semisal ada komponen  untuk mengambil inputan tanggal, dan  ingin menggunakannya di beberapa halaman. Sebelum ada React, maka harus melakukan inisiasi dengan memanggil function $.datepicker({}) berulang kali di tiap halamannya. Berbeda saat menggunakan React, cukup meletakkan komponen  dimanapun yang diinginkan, berapapun jumlahnya tanpa harus melakukan inisiasi berulang kali.
Easy To Mantain
Kelebihan lain dari konsep komponen based ini adalah lebih mudah untuk diperbaikki. Andai suatu saat  tak berfungsi dengan benar atau nge-bug atau error. Maka hanya perlu memperbaiki 1 file saja, yaitu file komponen Datepicker tersebut. Tanpa perlu mengubah semua kode di halaman tempat terpasangnya datepicker.
Fokus Pada Fungsi
Dengan adanya komponen yang berukuran kecil-kecil, maka komponen bisa fokus pada fungsinya masing-masing. Semisal komponen  maka komponen ini hanya fokus untuk menyediakan inputan tanggal saja. Tanpa perlu tau hasil inputannya bakal diolah seperti apa nantinya, bakal dikirim kemana, dll. yang jelas dia hanya fokus untuk menyediakan inputan tanggal saja.
Dengan konsep ini, komponen hanya memegang satu fungsi fokus. Sehingga apabila ada sesuatu yang aneh atau error, bisa tau atau mengira-ngira komponen yang mana yang harus diperbaiki / dicek.
React Itu Javascript
React sebenarnya hanyalah javascript biasa. Hanya saja React memiliki JSX yang memungkinkan untuk menulis syntax yang mirip dengan HTML kedalam file javascript. Berikut contoh komponen React dan JSX.
import React from 'react'

const MenuAtas = () => {
  return (

      LOGO




  )
}

Sekilas mirip HTML, tapi JSX ditulis pada file javascript. Dan nantinya JSX ini akan dirender sebagai element pada laman web.
Functional
React erat dengan function. Jadi sebelum belajar React, harus paham terlebih dahulu basic dari javascript dengan mengethaui cara menggunakan function, variable, method pada variable, pemanggilan variable dll. Untuk lebih detailnya akan dibahas pada Section Javascript. Berikut contoh bagaimana React sangat erat dengan function (Functional)
import React from 'react'
import ReactDOM from 'react-dom'

// Function biasa
const showName = () => {
  return "me"
}

console.log(showName()) // log: "me"

